$\begin{array}{ll}
\text{If } F 
\text{ is differentiable on } \mathbb{R}
\text{, then by substitution, }
\\\\
\displaystyle{
    \int^{b}_{a} 2xF'(x^2) \;dx
    = [F(b)-F(a)]
}
